var tipuesearch = {"pages":[{"url":"./pages/about/","text":"2016Fall 修課成員網誌","tags":"misc","title":"About"},{"url":"./w8.html","text":"心得 這周要自評和互評,讓我們能夠想想這些時間自己和組員到底做了什麼 自評 這周回想了這段時間自己和組員所做的事,在比較之下我覺得我幫助了許多人,所以這周給85分","tags":"Misc","title":"W8"},{"url":"./w7.html","text":"心得 這星期教了計算Solvespace的點路徑,然後因為我們的分組倉儲有問題所以需要除錯,雖然之前已經除錯過一次了但那是分組倉儲而不是個人倉儲所以處理起來沒有那麼麻煩,因為時間緊湊沒有拍影片所以我在這邊說明大致作法:首先找出有問題的組員倉儲,先把他踢出子模組,幫他把倉儲問題解決之後再加入,他的問題是把不該複製的像.git等檔案也複製過去導致其他人上傳的檔案無法更新,分組問題是他把分組倉儲也加入子模組內 自評 這周發現了很多以前沒有發現過的問題,雖然解決起來難度比較高但是解決了之後成就感也比較大,而且也學到了很多別人學不到的東西所以這周我給自己99分 2016-10-28 10-52-34 from 40423243 on Vimeo .","tags":"Misc","title":"W7"},{"url":"./w6.html","text":"心得 這周讓那些進度落後的同學趕上進度並介紹了OnShape這個網頁,他可以線上協同製圖,不但加速了交流也增加了分工的效率 自評 這周幫助了許多進度落後的同學不但發揮了十足的同理心也複習了指令,所以這周給70分","tags":"Misc","title":"W6"},{"url":"./w5.html","text":"心得 這周教了SolveSpace的用法,還有下載倉儲後面可以打hw這樣就不用整個抓了速度比較快,然後這周把上周的倉儲問題解決了,後來發現問題是分組倉儲也在子模組裡面所以造成bug 自評 這周解決了困擾我們小組已久的問題很開心,自己找到錯誤點並且除厝的感覺真的很棒很有成就感,這就是老師告訴我們出錯不一定是壞事的原因了吧,因為我很開心又解決問題了所以這周給98分 2016-10-14_15-48-47 from 40423243 on Vimeo . 2016-10-14_10-48-38 from 40423243 on Vimeo .","tags":"Misc","title":"W5"},{"url":"./w4.html","text":"心得 這星期教了 git config --global user.name \"your github login account\" git config --global user.email your@github.email.address git config --global http.proxy http://proxy.mde.tw:3128 git config --global https.proxy http://proxy.mde.tw:3128 這些指令和更改瀏覽器的proxy設定,這可以大大提升網路的速度,並介紹錄影工具ShareX,要到Task settings內的screen recorfing options和Application settings內的Paths設定,然後額外這周有碰到小組倉儲的問題如影片 自評 這周學到了一個不錯的錄影程式和加快網路速度的方法,我覺得非常實用,所以這周給85分 2016-10-07_11-54-18 from 40423243 on Vimeo .","tags":"Misc","title":"W4"},{"url":"./w3.html","text":"心得 這星期教fork和改主要倉儲分支,改主要倉儲分支很方便的地方是不用每次clone下來都改一次分支,然後教建立帳號.github.io倉儲並自行維護個人首頁,最後要找自選組員 自評 這周找到了許多組員,也發現了主分支的方便性,所以這周給75分","tags":"Misc","title":"W3"},{"url":"./w2.html","text":"心得 因為昨天晚上來上課的人很少,所以今天老師又說了一次昨天晚上的東西讓我們複習 自評 因為我昨天晚上有來,今天就沒什麼大問題,除了複習昨天交的外還又自己熟悉了一下操作,所以這周給70分","tags":"Misc","title":"W2"},{"url":"./w1.html","text":"心得 因為第一個星期放颱風假所以調到今天晚上上課,雖然這學期上課內容因應時代潮流所以要上別的但還是和上學期學的有關連,所以上起來還算上手 自評 這周照著老師的步調就很好上手,感覺上學期的東西都回憶起來了感覺還不錯,所以這周給80分","tags":"Misc","title":"W1"},{"url":"./2016fall-jian-bao-yu-wang-zhi-xi-tong.html","text":"這個系統共集結了 reveal.js 網際簡報與 pelican 靜態網誌系統. 網誌 Category 網誌 Tags reveal.js 使用導引","tags":"Misc","title":"2016Fall 簡報與網誌系統"}]};